var productGRPCHandler *gRPCHandler.ProductHandler
var userRepo *mock.MockUserRepository
var imagesRepository repository.ImagesRepository

func TestMain(m *testing.M) {
	setup()
	code := m.Run()
	tearDown()
	os.Exit(code)
}

func setup() {
	// Load testing configuration
	cfg, err := config.LoadConfig("../../cmd/config/config-test.yaml")
	if err != nil {
		panic(err)
	}

	// Set up a connection to the testing database
	db, err = database.NewDB(&cfg.Database)
	if err != nil {
		panic(err)
	}

	logFolder := flag.String("log.file", "../../logs", "Logging file")
	currentDir, err := os.Getwd()
	if err != nil {
		fmt.Println("Error:", err)
		return
	}

	fmt.Println("Current working directory:", currentDir)

	flag.Parse()

	// set logging file
	//logging.OutputScreen = true
	//logging.Filename = *logFile
	logging.InitLogger()
	currentDate := time.Now().Format("2006-01-02")
	logFilePath := fmt.Sprintf("%s/app_test_%s.log", *logFolder, currentDate)

	// Create the log file if it doesn't exist
	logFile, err := os.OpenFile(logFilePath, os.O_CREATE|os.O_WRONLY|os.O_APPEND, 0666)
	if err != nil {
		fmt.Println("Error creating log file: ", err)
		log.Fatal("Error creating log file:", err)
	}

	// Set the logrus output to the log file
	logging.Log.SetOutput(logFile)

	// Apply database migrations (if any)
	// You can use db.AutoMigrate(&YourModel{}) to automatically apply migrations

	// Create a product service and handler
	productRepository := repository.NewProductRepository(db)
	userRepo = mock.NewMockUserRepository()
	imagesRepository = repository.NewImagesRepository(cfg.ImagePath)
	productService := service.NewProductService(productRepository, userRepo, imagesRepository)
	productHandler = httpHandler.NewProductHandler(productService)
	productGRPCHandler = gRPCHandler.NewProductGRPCHandler(productService)

	go func() {
		// Create a gRPC server
		grpcServer := grpc.NewServer(grpc.UnaryInterceptor(middleware.LoggingInterceptor))

		// Register your gRPC service implementation
		pb.RegisterProductServer(grpcServer, productGRPCHandler)

		// Start gRPC server on a specific port
		listen, err := net.Listen("tcp", "localhost:50051")
		if err != nil {
			fmt.Println("Error starting gRPC server: ", err)
			//log.Fatal("Error starting gRPC server: %s", err.Error())
		}

		defer listen.Close()

		if err := grpcServer.Serve(listen); err != nil {
			fmt.Println("Error serving gRPC server ", err)
			//log.Fatal("Error serving gRPC server: %s", err.Error())
		}
	}()

}

func clearDB(tables []string) {
	sqlDB, err := db.DB()
	if err != nil {
		panic(err)
	}
	for _, v := range tables {
		sqlDB.Exec("delete from " + v)
	}

}

func tearDown() {
	sqlDB, err := db.DB()
	if err != nil {
		panic(err)
	}
	defer sqlDB.Close()

}

